class Piece():
    def __init__(self, color, type_, location):
        self.color = color
        self.type_ = type_
        self.location = location
        self.x = ord(self.location[0])-96
        self.y = int(self.location[1])
        self.valid_moves = None

    def __repr__(self):
        return self.color + self.type_ + '@' + self.location

    def designation(self):
        return self.color + self.type_

    def lookup_moves(self):
        if self.color =='w':
            opposite_color = 'b'
        else:
            opposite_color = 'w'

        if self.type_ == 'p':
            key_type = self.color + 'p'
            notation_type = ''
        else:
            key_type = 'a' + self.type_
            notation_type = self.type_.upper()

        try:
            possible_moves = ACTMAP[self.location][key_type]
        except KeyError:
            possible_moves = {}

        return possible_moves

